steps.prompt_log:
Sample Prompt:
Example_1:
input: ['.', 'c', 'c', 'c', 'c', '.', '.', 'h', '.']
output: ['.', '.', '.', 'c', 'c', 'c', 'c', 'h', '.']

Example_2:
input: ['f', 'f', 'f', 'f', 'f', '.', '.', 'h', '.']
output: ['.', '.', 'f', 'f', 'f', 'f', 'f', 'h', '.']

Example_3:
input: ['.', 'a', 'a', 'a', 'a', '.', '.', 'h', '.']
output: ['.', '.', '.', 'a', 'a', 'a', 'a', 'h', '.']

Test case:
input: ['g', 'g', 'g', 'g', '.', '.', 'h', '.', '.']

###########################################################
Sample Outputs:
output: ['.', '.', '.', 'g', 'g', 'g', 'g', 'h', '.']
*/

public class MoveZerosToEnd {
    public static void main(String[] args) {
        char[] input = {'g','g','g','g','.','.','h','.'};
        System.out.println("Input : ");
        printArray(input);
        moveZeroesToEnd(input);
        System.out.println("\nOutput :");
        printArray(input);
    }

    private static void moveZeroesToEnd(char[] arr){
        int j=0;
        for (int i = 0; i < arr.length; i++) {
            if(arr[i]!='.'){
                swap(arr,j,i);
                j++;
            }
        }
    }

    private static void swap(char[] arr, int a, int b) {
        char temp = arr[a];
        arr[a]=arr[b];
        arr[b]=temp;
    }

    private static void printArray(char[] arr){
        for (int i = 0; i < arr.length; i++) {
            System.out.print(arr[i]+" ");
        }
    }
}
